function appendProjectCard(e,s,n,o){$("#u-carousel").append(`\n        <div class="u-carousel-item p-4 card m-2 u-card">\n            <span class="u-text-brand font-weight-bold"> ${e}</span > \n            <hr>\n            <div style="height: 100px;">\n                <span class="w-date">${n}</span>\n\n            </div>\n\n            <a target="_blank"\n                class="u-button px-3 py-2"\n                href="${s}"\n                rel="noreferrer">\n                Project Details\n            </a>\n\n        </div>\n    \n    \n    `),console.log(e,s,n)}let data;const url="https://api.github.com/users/utpal-barman/repos",response=fetch(url).then(e=>e.json()).catch(e=>console.log(e));response.then(e=>{for(i=0;i<e.length;i++)appendProjectCard(e[i].name,e[i].html_url,e[i].description,i);$("#u-carousel").slick({dots:!1,speed:700,autoplay:!0,autoplaySpeed:3e3,arrows:!0,appendArrows:$("#u-carousel"),slidesToShow:3,slidesToScroll:2,responsive:[{breakpoint:981,settings:{arrows:!1,centerPadding:"40px",slidesToShow:2,slidesToScroll:1}},{breakpoint:768,settings:{arrows:!1,centerPadding:"40px",slidesToShow:1,slidesToScroll:1}}]})});